import unittest
from unittest.mock import Mock, patch
import azure.functions as func
import function_app
from PIL import Image
import io
import base64
from helper_functions import return_error, process_image
from constants import CONTENT_TYPES_VALID, IMAGE_TYPES_VALID

# width: 1296, height: 968
BASE64_IMAGE = ''
BASE64_IMAGE_WIDTH = 1296
BASE64_IMAGE_HEIGHT = 968

# testing return_error function
def test_return_error(self):
    response = return_error('This is an error message.', status=400)
    self.assertEqual(response.status_code, 400)
    self.assertEqual(response.get_body(), b'{"error": "This is an error message."}')

# testing process_image function with json data
def test_process_image_json(self):

    # Creating a mock request
    mock_request = Mock(func.HttpRequest)
    mock_request.get_json.return_value = {'image': 'data:image/jpeg;base64,' + BASE64_IMAGE}

    # Calling the process_image function
    img = process_image(mock_request)

    # Asserting the response
    self.assertEqual(img.width, BASE64_IMAGE_WIDTH)
    self.assertEqual(img.height, BASE64_IMAGE_HEIGHT)

# testing process_image function with multipart/form-data
def test_process_image_multipart(self):

    # Creating a mock request
    mock_request = Mock(func.HttpRequest)
    mock_request.files = {'image': 'data:image/jpeg;base64,' + BASE64_IMAGE}

    # Calling the process_image function
    img = process_image(mock_request)

    # Asserting the response
    self.assertEqual(img.width, BASE64_IMAGE_WIDTH)
    self.assertEqual(img.height, BASE64_IMAGE_HEIGHT)    

if __name__ == '__main__':
    unittest.main()